import React from 'react';

const TweetsList = ({tweets}) => (
    <>
    <div className="grid-container">
        <h1>Tweets:</h1>
    {tweets.map((tweet, key) => (
        <>
        <div className="tweet" key={key}>
            <h4>ID {tweet.id}</h4>
            <p>{tweet.text}</p>
        </div>
        <br/>
        </>
    ))}
    </div>
  
    <br/>
    </>
)

export default TweetsList;
